import React from 'react';
import '../menu.css';

const Menu = () => {
  return (
    <div className="menu">
    <ul>
      <li><Link to="/leave-request-form">Open Leave Request Form</Link></li>
      <li>Leave Request</li>
      <li>Staff List</li>
      <li>Logout</li>
    </ul>
    </div>
  );
};

export default Menu;
